### Summary of Core Topics, Concepts, Principles, and Equations

#### HTML and JavaScript
1. **Accessing HTML Elements with JavaScript**
   - `document.getElementById("id")`
   - `document.getElementsByClassName("class")[index]`

2. **`<noscript>` Tag**
   - Used to provide alternate content when JavaScript is disabled.
   - Syntax: `<noscript>Alternate content</noscript>`

3. **JavaScript Classes and Objects**
   - Class definition and usage.
   - Static methods and constructors.
   - Example:
     ```javascript
     class Person {
         constructor(name) {
             this.name = name;
             this.age = 23;
         }
         static fromJson(obj) {
             let new_obj = new Person(obj.name);
             new_obj.sound = obj.sound;
             return new_obj;
         }
     }
     ```

4. **JavaScript Scope and `this` Keyword**
   - Lexical scope and variable resolution.
   - Arrow functions and their scope.
   - Example:
     ```javascript
     let x = 50;
     const obj1 = {
       x: 10,
       func: function() {
         console.log(this.x)
       }
     }
     ```

5. **JavaScript Functions and Closures**
   - Function definitions and closures.
   - Example:
     ```javascript
     function outer() {
         function inner() {
             return x + y
         }
         return inner
     }
     ```

6. **JavaScript Arrays and Loops**
   - Array methods like `map`, `sort`, and `forEach`.
   - While loops and their usage.
   - Example:
     ```javascript
     function do_something(arr, val) {
         var i1 = 0;
         var i2 = arr.length;
         while (i2 > i1) {
             var i3 = Math.floor((i1 + i2) / 2);
             if (val > arr[i3]) {
                 i1 = i3 + 1;
             }
             else if (val < arr[i3]) {
                 i2 = i3;
             }
             else {
                 return true;
             }
         }
         return false;
     }
     ```

#### Vue.js
1. **Vue Instance and Data Binding**
   - Creating a Vue instance.
   - Data binding with `v-model` and `v-for`.
   - Example:
     ```javascript
     new Vue({
       el: '#app',
       data: {
         items: [
           { id: 1, name: 'App Dev I Theory' },
           { id: 2, name: 'App Dev I Project' },
           { id: 3, name: 'App Dev II Theory' },
           { id: 4, name: 'App Dev II Project' }
         ]
       }
     });
     ```

2. **Vue Components**
   - Defining and using components.
   - Props and templates.
   - Example:
     ```javascript
     Vue.component('blog-post', {
         props: {
             postTitle: String,
             postContent: String
         },
         template: `
             <div>
                 <h3>{{ postTitle }}</h3>
                 <p>{{ postContent }}</p>
             </div>
         `
     });
     ```

3. **Vue Computed Properties and Watchers**
   - Computed properties and their usage.
   - Watchers and their usage.
   - Example:
     ```javascript
     new Vue({
       el: '#app',
       data: {
         num: 1,
         prev: 0,
         current: 1,
         lucky: false,
       },
       watch: {
         num(num1, num2) {
           if (num1 === '') {
             return
           }
           this.prev = this.current
           this.current = Number(num1)
           this.current > this.prev ? (this.lucky = true) : (this.lucky = false)
         }
       },
     })
     ```

